(38, 193, 3, 5, 'All that glitters is not gold; all that wander are not lost.', '2013-04-05 20:17:17', '2013-04-05 20:17:17'),
(39, 280, 4, 5, 'Fremen speech implies great concision, a precise sense of expression. It is \nimmersed in the illusion of absolutes. Its assumptions are a fertile ground for \nabsolutist religions. Furthermore, Fremen are fond of moralizing. They confront \nthe terrifying instability of all things with institutionalized statements. \nThey say: "We know there is no summa of all attainable knowledge; that is the \npreserve of God. But whatever men can learn, men can contain." Out of this \nknife-edged approach to the universe they carve a fantastic belief in signs and \nomens and in their own destiny. This is an origin of their Kralizec legend: the \nwar at the end of the universe.\n\n-Bene Gesserit Private Reports/folio 800881', '2013-04-04 10:33:36', '2013-04-04 10:33:36'),
(40, 100, 2, 1, '"That unit is a woman."\r\n	"A mass of conflicting impulses."\r\n		-- Spock and Nomad, "The Changeling", stardate 3541.9', '2013-04-25 14:09:02', '2013-04-25 14:09:02'),
(41, 124, 3, 4, 'Vulcans believe peace should not depend on force.\n		-- Amanda, "Journey to Babel", stardate 3842.3', '2013-04-05 02:09:38', '2013-04-05 02:09:38'),
(42, 253, 4, 4, 'Did you hear? Detroit is building a new stadium but it is keeping its location hidden from the public.\r\n\r\nYeah, they''re afraid the Tigers will find out where it is and try to play there.', '2013-04-16 11:47:10', '2013-04-16 11:47:10'),
(43, 220, 5, 4, '10.090\n`Equality is not the means to achieve equality.'' (Joan Scott)', '2013-04-16 07:56:28', '2013-04-16 07:56:28'),
(44, 65, 3, 4, 'FLIGHT DELAY\r\nA doctor and a Baptist minister were seated next to each other on a plane. The plane was delayed due to technical problems. Just after taking off, the pilot offered his apologies to the passengers and announced that a round of free drinks would be served. When the hostess came round with the trolley, the doctor ordered a gin and tonic. The hostess then asked the minister whether he wanted anything. He replied, "Oh, no thank you. I would rather commit adultery than drink alcohol." The doctor promptly handed his gin and tonic back to the hostess said, "Madam, I didn''t know there was a choice."', '2013-04-23 10:22:59', '2013-04-23 10:22:59'),
(45, 100, 3, 4, 'Tourists\r\nPeople who are taking training classes just to get a vacation from their jobs. "We had about three serious students in the class; the rest were tourists."', '2013-04-16 00:20:19', '2013-04-16 00:20:19'),
(46, 246, 4, 3, '"Principal Skinner is an old man who lives at the school."\n\n	--Ralph Wiggum\n	  The Principal and the Pauper (Episode 4F23)', '2013-04-15 08:37:42', '2013-04-15 08:37:42'),
(47, 18, 4, 1, 'Don''t despise your poor relations, they may become suddenly rich one day.\n		-- Josh Billings', '2013-04-29 19:17:28', '2013-04-29 19:17:28'),
(48, 266, 4, 3, '"...my father is the Emperor of Klatch and my mother is a small tray of\nraspberry puddings."\n        -- Agnes tells Christine about herself\n           (Terry Pratchett, Maskerade)', '2013-04-27 18:42:34', '2013-04-27 18:42:34'),
(49, 256, 4, 2, 'The actor who portrayed the "Marlboro Man" in print and television cigarette ads died of lung cancer.', '2013-04-03 16:14:06', '2013-04-03 16:14:06'),
(50, 123, 1, 2, 'From "Monty Python and the Holy Grail"\n\n      [clop clop]\nARTHUR:  Halt!  Hallo!  Hallo!\nGUARD:  ''Allo!  Who is zis?\nARTHUR:  It is King Arthur, and these are the Knights of the Round Table.  Who''s\n         castle is this?\nGUARD:  This is the castle of my master, Guido Wommer!\nARTHUR:  Go and tell your master that we have been charged by God with a sacred\n         quest.  If he will give us food and shelter for the night he can join\n         us in our quest for the Holy Grail.\nGUARD:  Well, I''ll ask him, but I don''t think he''ll be very keen... Uh, he''s\n        already got one, you see?\nARTHUR:  What?\nGALAHAD:  He says they''ve already got one!', '2013-04-05 06:18:49', '2013-04-05 06:18:49'),
(51, 125, 5, 2, 'New York-- to that tall skyline I come\nFlyin'' in from London to your door\nNew York-- lookin'' down on Central Park\nWhere they say you should not wander after dark.\nNew York.\n		-- Simon and Garfunkle', '2013-04-06 10:06:33', '2013-04-06 10:06:33'),
(52, 269, 4, 2, 'I don''t wanna argue, and I don''t wanna fight,\r\nBut there will definitely be a party tonight...', '2013-04-03 22:37:45', '2013-04-03 22:37:45'),
(53, 43, 2, 3, 'From "Monty Python and the Holy Grail"\n\n      [clop clop]\nARTHUR:  Halt!  Hallo!  Hallo!\nGUARD:  ''Allo!  Who is zis?\nARTHUR:  It is King Arthur, and these are the Knights of the Round Table.  Who''s\n         castle is this?\nGUARD:  This is the castle of my master, Guido Wommer!\nARTHUR:  Go and tell your master that we have been charged by God with a sacred\n         quest.  If he will give us food and shelter for the night he can join\n         us in our quest for the Holy Grail.\nGUARD:  Well, I''ll ask him, but I don''t think he''ll be very keen... Uh, he''s\n        already got one, you see?\nARTHUR:  What?\nGALAHAD:  He says they''ve already got one!', '2013-04-12 03:21:01', '2013-04-12 03:21:01'),
(54, 298, 1, 2, 'After all, what is your hosts'' purpose in having a party?\r\nSurely not for you to enjoy yourself; if that were their sole\r\npurpose, they''d have simply sent champagne and women over to\r\nyour place by taxi.\r\n\r\n	-- P. J. O''Rourke', '2013-04-04 00:20:35', '2013-04-04 00:20:35'),
(55, 225, 3, 3, 'Women reason with the heart and are much less often wrong than men who\r\nreason with the head.\r\n		-- DeLescure', '2013-04-12 17:53:47', '2013-04-12 17:53:47'),
(56, 103, 5, 2, 'Ridcully was to management what King Herod was to the Bethlehem Playgroup\nAssociation. His mental approach to it could be visualised as a sort of\nbusiness flowchart with, at the top, a circle entitled "Me, who does the\ntelling" and, connected below it by a line, a large circle entitled\n"Everyone else".\n(The Last Continent)', '2013-04-22 05:38:35', '2013-04-22 05:38:35'),
(57, 299, 4, 3, 'Marge: Oh, Homer, there seems to be a lot of good obedience schools here.\r\nBart: Oh, school, right, yeah, that''s your answer to everything...\r\n\r\n	-- finding a school for Santa''s Little Helper,\r\n	  "Bart''s Dog Gets an F"', '2013-04-10 11:11:04', '2013-04-10 11:11:04'),
(58, 106, 1, 5, 'Jo Sheldon: "A brain Scan revealed that Andrew Caddick is not suffering from \r\nstress fracture of the shin."', '2013-04-14 10:12:58', '2013-04-14 10:12:58'),
(59, 153, 4, 1, 'The two most common elements in the universe are hydrogen and stupidity.', '2013-04-10 08:09:08', '2013-04-10 08:09:08'),
(60, 258, 5, 2, 'When smashing monuments, save the pedstals -- they always come in handy.\r\n		-- Stanislaw J. Lem, "Unkempt Thoughts"', '2013-04-17 23:15:01', '2013-04-17 23:15:01'),
(61, 166, 4, 2, 'To fear love is to fear life, and those who fear life are already three\nparts dead.\n		-- Bertrand Russell', '2013-04-12 17:14:14', '2013-04-12 17:14:14'),
(62, 270, 3, 1, 'CONDOMS GROWING ON TREES IN SAFE SEX PUSH\r\n(Australia) A health service in Western Australia''s Kimberley region has come up with an innovative way of promoting safe sex in Aboriginal communities. The program provides free condoms at unusual outdoor locations. Posters around Fitzroy Crossing advertise "Free Condoms in a Tree Near You." Under the program, canisters of condoms are hung from trees where different Aboriginal language groups traditionally gather. Patrick Davies from the Nindin-lin-gaari Cultural Health Center says the idea follows concern over the high rate of sexually transmitted diseases. He says previously people were embarrassed about getting condoms from the only outlets in townâthe hospital or the news agency. "We were able to target the people from outlying communities when they came into town by hanging these PVC containers under those treesâthey take about 2,500 or 3,000 every month," he said.', '2013-04-24 07:25:59', '2013-04-24 07:25:59'),
(63, 208, 1, 4, 'bug, n:\r\n	A son of a glitch.', '2013-04-05 18:22:36', '2013-04-05 18:22:36'),
(64, 149, 3, 2, 'HEMP. Young hemp; an appellation for a graceless boy.', '2013-05-01 10:57:06', '2013-05-01 10:57:06'),
(65, 175, 1, 1, 'Back in the early 60''s, touch tone phones only had 10 buttons.  Some\nmilitary versions had 16, while the 12 button jobs were used only by people\nwho had "diva" (digital inquiry, voice answerback) systems -- mainly banks.\nSince in those days, only Western Electric  made "data sets" (modems) the\nproblems of terminology were all Bell System.  We used to struggle with\nwritten descriptions of dial pads that were unfamiliar to most people\n(most phones were rotary then.)  Partly in jest, some AT&T engineering\ntypes (there was no marketing in the good old days, which is why they were\nthe good old days) made up the term "octalthorpe" (note spelling) to denote\nthe "pound sign."  Presumably because it has 8 points sticking out.  It\nnever really caught on.', '2013-04-17 23:00:31', '2013-04-17 23:00:31'),
(66, 125, 3, 1, 'How do you make a small fortune in Texas oil?\r\n\r\nStart with a big one.', '2013-04-06 11:29:36', '2013-04-06 11:29:36'),
(67, 226, 1, 2, '"Ain''t that something what happened today.  One of us got traded to\nKansas City."\n		-- Casey Stengel, informing outfielder Bob Cerv he''d\n		   been traded.', '2013-04-20 14:04:13', '2013-04-20 14:04:13'),
(68, 264, 5, 1, 'Someday your prints will come.\n		-- Kodak', '2013-04-28 00:14:48', '2013-04-28 00:14:48'),
(69, 85, 3, 4, '"The glamorous 17-year-old wants to be a policewoman some day, like her dad." -- From a New Zealand paper.', '2013-04-10 05:59:56', '2013-04-10 05:59:56'),
(70, 85, 3, 3, 'Most people are too busy to have time for anything important.', '2013-04-08 17:53:52', '2013-04-08 17:53:52'),
(71, 198, 2, 2, 'A young honeymoon couple were touring southern Florida and happened \r\nto stop at one of the rattlesnake farms along the road.  After seeing the \r\nsights, they engaged in small talk with the man that handled the snakes.\r\n"Gosh!" exclaimed the new bride.  "You certainly have a dangerous job.\r\nDon''t you ever get bitten by the snakes?"\r\n	"Yes, upon rare occasions," answered the handler.\r\n	"Well," she continued, "just what do you do when you''re bitten by\r\na snake?"\r\n	"I always carry a razor-sharp knife in my pocket, and as soon as I\r\nam bitten, I make deep criss-cross marks across the fang entry and then\r\nsuck the poison from the wound."\r\n	"What, uh... what would happen if you were to accidentally *sit* on\r\na rattler?" persisted the woman.\r\n	"Ma''am," answered the snake handler, "that will be the day I learn\r\nwho my real friends are."', '2013-05-01 08:43:57', '2013-05-01 08:43:57'),
(72, 19, 1, 5, 'Men never make passes at girls wearing glasses.\n		-- Dorothy Parker', '2013-04-17 22:38:06', '2013-04-17 22:38:06'),
