(75, 268, 4, 2, 'Hi there!  This is just a note from me, to you, to tell you, the person\nreading this note, that I can''t think up any more famous quotes, jokes,\nnor bizarre stories, so you may as well go home.', '2013-04-29 15:51:48', '2013-04-29 15:51:48'),
