(1, 'Once a woman has given you her heart you can never get rid of the rest of her.\r\n		-- Vanbrugh'),
(2, 'Old steelmakers never die, they just lose their temper.'),
(3, 'Four thousand throats may be cut in one night by a running man.\n		-- Klingon Soldier, "Day of the Dove", stardate unknown'),
(4, 'Mathematics consists of proving the most obvious thing in the least \nobvious way.\n	                          -- G. Polya'),
(5, 'If it''s Tuesday, this must be someone else''s fortune.'),
(6, 'Loosely confederate colors of Benetton'),
(7, 'The wind and waves are always on the side of the ablest\r\nnavigators.\r\n\r\n	-- Edward Gibbon'),
(8, 'Be prepared to accept sacrifices.  Vestal virgins aren''t all that bad.'),
(9, 'Proverbs 28:18\nHe whose walk is blameless is kept safe, but he whose ways are \nperverse will suddenly fall.'),
(10, 'Travel important today;  Internal Revenue men arrive tomorrow.'),
(11, 'To be or not to be, that is the bottom line.'),
(12, 'Karate was not introduced to Japan until 1917.'),
(13, 'It is equally bad when one speeds on the guest unwilling to go, and when he\r\nholds back one who is hastening.  Rather one should befriend the guest who\r\nis there, but speed him when he wishes.\r\n		-- Homer, "The Odyssey"\r\n \r\n	[Quoted in "VMS Internals and Data Structures", V4.4, when\r\n	 referring to scheduling.]'),
(14, 'Nothing will ever be attempted if all possible objections must be first\r\novercome.\r\n		-- Dr. Johnson'),
(15, 'Budget: A method for going broke methodically.'),
(16, 'TO NURSE. To cheat: as, they nursed him out of it. An\r\n  estate in the hands of trustees, for the payment of\r\n  bdebts, is said to be at nurse.'),
(17, 'DOG ALARMS MASTER WITH EXPLOSIVE ''FETCH''\r\n(Brazil, Reuters) A Brazilian dog with a strong instinct to retrieve brought his master an unwelcome gift recentlyâa smoking grenade. "He dropped it on the floor and smoke began to come out of it," local news wire Estadao.com quoted the dog''s owner, Haroldo Renato Mota, as saying. Police in the city of Sao Jose dos Campos, some 60 miles north of Sao Paulo, detonated the rusted weapon. Mota said "Chumbinho," a black and white dog of mixed ancestry, had in the past brought home an old bicycle wheel and a .22 caliber revolver. "The only thing he has not brought yet is money," Mota said.'),
(18, '"Protozoa are small, and bacteria are small, but viruses are smaller\r\nthan the both put together."'),
(19, 'It''s Like This\r\n\r\nEven the samurai\r\nhave teddy bears,\r\nand even the teddy bears\r\nget drunk.'),
(20, 'Time \nIs tapping on my forehead, \nHanging from my mirror, \nRattling the teacups, \nAnd I wonder, \nHow long can I delay? \nWe''re just a habit \nLike saccharin. \n\n- as sung by Simon & Garfunkel "Overs"'),
(21, 'One Page Principle:\r\n	A specification that will not fit on one page of 8.5x11 inch\r\npaper cannot be understood.\r\n\r\n	-- Mark Ardis'),
(22, 'What''s so funny?'),
(23, 'SQUIB. A small satirical or political temporary jeu d''esprit,\r\n  which, like the firework of that denomination, sparkles,\r\n  bounces, stinks, and vanishes.'),
(24, 'It''s said that pigeons are the smartest people around; they''re always getting\r\nthe drop on the rest of us.\r\n\r\n	-- Anonymous'),
(25, 'Clans of long ago that wanted to get rid of their unwanted people without killing them \r\nuse to burn their houses down - hence the expression "to get fired."'),
(26, 'New York-- to that tall skyline I come\nFlyin'' in from London to your door\nNew York-- lookin'' down on Central Park\nWhere they say you should not wander after dark.\nNew York.\n		-- Simon and Garfunkle'),
(27, 'When smashing monuments, save the pedstals -- they always come in handy.\r\n		-- Stanislaw J. Lem, "Unkempt Thoughts"'),
(28, 'Palindrome:\r\nI''m runnin''! - Nurmi'),
(29, 'Absurdity: A statement of belief inconsistent with one''s own opinion.'),
(30, 'PEEPER. A spying glass; also a looking-glass. Track up\r\n  the dancers, and pike with the peeper; whip up stairs,\r\n  and run off with the looking-glass. CANT.'),
(31, 'Invest in physics -- own a piece of Dirac!'),
(32, 'He who joyfully marches to music in rank and file has already earned my\ncontempt.  He has been given a large brain by mistake, since for him the\nspinal cord would fully suffice.\n	-- Albert Einstein'),
(33, 'You''re at the end of the road again.'),
(34, '03.040\nShowing the false to be false does not prove the truth to be true; but not\nvice-versa.'),
(35, 'From a student in America''s fine public school system:\r\n  The Greeks were a highly sculptured people, and without them we wouldn''t have \r\n  history. The Greeks also had myths. A myth is a female moth.'),
(36, '*** STUDENT SUCCESSES ***\r\n\r\nMany of our students have gone on to achieve great success in all fields of\r\nprogramming.  One former student developed the concept of the personalized\r\nform letter.  Does the phrase, "Dear Mr.(insert name), You may already be a\r\nwinner!," sound familiar?  Another student writes "After only five lessons I\r\nsold a "My Most Unforgettable Program" article to Corrosive Computing magazine.\r\nAnother of our graduates writes, "I recently completed a database-management\r\nprogram for my department manager.  My program touched him so deeply that he\r\nwas speechless.  He told me later that he had never seen such a program in\r\nhis entire career.  Thank you, Famous Programmers'' school; only you could\r\nhave made this possible."  Send for our introductory brochure which explains\r\nin vague detail the operation of the Famous Programmers'' School, and you''ll\r\nbe eligible to win a possible chance to enter a drawing, the winner of which\r\ncan vie for a set of free steak knives.  If you don''t do it now, you''ll hate\r\nyourself in the morning.'),
(37, 'Remember, Grasshopper, falling down 1000 stairs begins by tripping over\r\nthe first one.\r\n		-- Confusion'),
(38, 'A rose is a rose is a rose.  Just ask Jean Marsh, known to millions of\nPBS viewers in the ''70s as Rose, the maid on the BBC export "Upstairs,\nDownstairs."  Though Marsh has since gone on to other projects, ... it''s\nwith Rose she''s forever identified.  So much so that she even likes to\njoke about having one named after her, a distinction not without its\ndrawbacks.  "I was very flattered when I heard about it, but when I looked\nup the official description, it said, `Jean Marsh: pale peach, not very\ngood in beds; better up against a wall.''  I want to tell you that''s not\ntrue.  I''m very good in beds as well."'),
(39, 'Take the folks at Coca-Cola.  For many years, they were content\r\nto sit back and make the same old carbonated beverage.  It was a good\r\nbeverage, no question about it; generations of people had grown up\r\ndrinking it and doing the experiment in sixth grade where you put a\r\nnail into a glass of Coke and after a couple of days the nail dissolves\r\nand the teacher says: "Imagine what it does to your TEETH!"  So Coca-Cola\r\nwas solidly entrenched in the market, and the management saw no need to\r\nimprove ...\r\n		-- Dave Barry, "In Search of Excellence"'),
(40, 'TARZAN AND OAK\r\nTarzan had been living alone in his jungle kingdom for 25 years with only suitably shaped holes in trees for sex. Jane, a reporter, came to Africa in search of this legendary figure. One day, deep in the wild she came to a clearing and discovered Tarzan vigorously thrusting into a jungle oak. She watched in awe for a while. Finally, overcome by this display of animal passion, Jane came out into the open and offered herself to him. As she reclined on the wild grass, Tarzan became aroused. He quickly ran over and kicked her in the crotch. In pain, she screamed, "What the hell did you do that for?" Tarzan replied, "Tarzan always check for squirrels."'),
(41, 'Good day to avoid cops. Crawl to school.'),
(42, 'The Microsoft Motto: "We''re the leaders, wait for us!"'),
(43, 'TWO TYPES\r\nThere are two different types of people in this world. 1) Those who finish what they start.'),
(44, 'Down to the Banana Republics,\r\nDown to the tropical sun.\r\nGo the expatriated Americans,\r\nHoping to find some fun.\r\nSome of them go for the sailing,\r\nCaught by the lure of the sea.\r\nTrying to find what is ailing,\r\nLiving in the land of the free.\r\nSome of them are running from lovers,\r\nLeaving no forward address.\r\nSome of them are running tons of ganja,\r\nSome are running from the IRS.\r\nLate at night you will find them,\r\nIn the cheap hotels and bars.\r\nHustling the senoritas,\r\nWhile they dance beneath the stars.\r\n		-- Jimmy Buffet, "Banana Republics"'),
(45, 'All of us should treasure his Oriental wisdom and his preaching of a\r\nZen-like detachment, as exemplified by his constant reminder to clerks,\r\ntellers, or others who grew excited by his presence in their banks:\r\n"Just lie down on the floor and keep calm."\r\n		-- Robert Wilson, "John Dillinger Died for You"'),
(46, 'Proposed Additions to the PDP-11 Instruction Set:\r\n\r\n	-- BBW	Branch Both Ways\r\nBEW	Branch Either Way\r\nBBBF	Branch on Bit Bucket Full\r\nBH	Branch and Hang\r\nBMR	Branch Multiple Registers\r\nBOB	Branch On Bug\r\nBPO	Branch on Power Off\r\nBST	Backspace and Stretch Tape\r\nCDS	Condense and Destroy System\r\nCLBR	Clobber Register\r\nCLBRI	Clobber Register Immediately\r\nCM	Circulate Memory\r\nCMFRM	Come From -- essential for truly structured programming\r\nCPPR	Crumple Printer Paper and Rip\r\nCRN	Convert to Roman Numerals'),
(47, '"You''re a creature of the night, Michael.  Wait''ll Mom hears about this."\r\n-- from the movie "The Lost Boys"'),
(48, 'I like the way ONLY their mouths move ...  They look like DYING OYSTERS'),
(49, 'I''m sorry if the correct way of doing things offends you.'),
(50, 'You will be surprised by a loud noise.'),
(51, 'Proverbs 7:1-5\n1. My son, keep my words and store up my commands within you.\n2. Keep my commands and you will live; guard my teachings as the \napple of your eye.\n3. Bind them on your fingers; write them on the tablet of your heart.\n4. Say to wisdom, "You are my sister," and call understanding your \nkinsman;\n5. they will keep you from the adulteress, from the wayward wife with \nher seductive words.'),
(52, 'Millihelen, adj:\r\n	The amount of beauty required to launch one ship.'),
(53, '''Charity ain''t giving people what you wants to give, it''s giving people what they need to get.''\n(Hogfather)'),
(54, 'I made wine out of raisins so I wouldn''t have to wait for it to age.\n						-- Stephen Wright'),
(55, '... But if we laugh with derision, we will never understand.  Human\nintellectual capacity has not altered for thousands of years so far as\nwe can tell.  If intelligent people invested intense energy in issues\nthat now seem foolish to us, then the failure lies in our understanding\nof their world, not in their distorted perceptions.  Even the standard\nexample of ancient nonsense -- the debate about angels on pinheads --\nmakes sense once you realize that theologians were not discussing\nwhether five or eighteen would fit, but whether a pin could house a\nfinite or an infinite number.\n		-- S. J. Gould, "Wide Hats and Narrow Minds"'),
(56, 'Half the world is composed of people who have something to say and can''t,\r\nand the other half who have nothing to say and keep on saying it.'),
(57, 'You may be an engineer if....\r\nIf you thought the real heroes of "Apollo 13" were the mission controllers'),
(58, 'You knew the job was dangerous when you took it, Fred.\r\n		-- Superchicken'),
(59, 'Don''t feed the bats tonight.'),
(60, 'Women professionals do tend to over-compensate.\r\n		-- Dr. Elizabeth Dehaver, "Where No Man Has Gone Before",\r\n		   stardate 1312.9.'),
(61, 'When a man knows he is to be hanged in a fortnight, it concentrates his\r\nmind wonderfully.\r\n		-- Samuel Johnson'),
(62, '04.080\nThe alternative to tasawwuf is wool-gathering.'),
(63, '"And remember: Evil will always prevail, because Good is dumb."\r\n-- Spaceballs'),
(64, 'Truthful, adj.:\r\nDumb and illiterate.\r\n\r\n	-- Ambrose Bierce, "The Devil''s Dictionary"'),
(65, 'The act of sneezing is called "sternutation."'),
(66, 'Not far from here, by a white sun, behind a green star, lived the\r\nSteelypips, illustrious, industrious, and they hadn''t a care: no spats in\r\ntheir vats, no rules, no schools, no gloom, no evil influence of the\r\nmoon, no trouble from matter or antimatter -- for they had a machine, a\r\ndream of a machine, with springs and gears and perfect in every respect.\r\nAnd they lived with it, and on it, and under it, and inside it, for it\r\nwas all they had -- first they saved up all their atoms, then they put\r\nthem all together, and if one didn''t fit, why they chipped at it a bit,\r\nand everything was just fine ...\r\n		-- Stanislaw Lem, "Cyberiad"'),
(67, '"How would I know if I believe in love at first sight?" the sexy\r\nsocial climber said to her roommate.  "I mean, I''ve never seen a Porsche\r\nfull of money before."'),
(68, 'Did you hear? Detroit is building a new stadium but it is keeping its location hidden from the public.\r\n\r\nYeah, they''re afraid the Tigers will find out where it is and try to play there.'),
(69, 'MAHOMETAN GRUEL. Coffee: because formerly used\r\n  chiefly by the Turks.'),
(70, 'Caution: breathing may be hazardous to your health.'),
(71, '"The world''s crazy, when it comes to beauty."\r\n     Richard Bach, Spoken by Leslie Parrish, The Bridge Across Forever'),
(72, 'Someday your prints will come.\n		-- Kodak'),
(73, 'Fremen speech implies great concision, a precise sense of expression. It is \nimmersed in the illusion of absolutes. Its assumptions are a fertile ground for \nabsolutist religions. Furthermore, Fremen are fond of moralizing. They confront \nthe terrifying instability of all things with institutionalized statements. \nThey say: "We know there is no summa of all attainable knowledge; that is the \npreserve of God. But whatever men can learn, men can contain." Out of this \nknife-edged approach to the universe they carve a fantastic belief in signs and \nomens and in their own destiny. This is an origin of their Kralizec legend: the \nwar at the end of the universe.\n\n-Bene Gesserit Private Reports/folio 800881'),
(74, 'Troubles are like babies; they only grow by nursing.'),
(75, 'The actor who portrayed the "Marlboro Man" in print and television cigarette ads died of lung cancer.'),
(76, 'When love is gone, there''s always justice.\r\nAnd when justice is gone, there''s always force.\r\nAnd when force is gone, there''s always Mom.\r\nHi, Mom!\r\n\r\n	-- Laurie Anderson'),
(77, 'To err is human, to moo bovine.'),
(78, '(to "The Caissons Go Rolling Along")\r\n\r\n	Scratch the disks, dump the core,\r\n	Shut it down, pull the plug\r\n	Roll the tapes across the floor,\r\n	Give the core an extra tug\r\n		And the system is going to crash.\r\n		And the system is going to crash.\r\n	Teletypes smashed to bits. Mem''ry cards, one and all,\r\n	Give the scopes some nasty hits\r\n	Toss out halfway down the hall\r\n		And the system is going to crash.\r\n		And the system is going to crash.\r\n	And we''ve also found Just flip one switch\r\n	When you turn the power down,\r\n	And the lights will cease to twitch\r\n	You turn the disk readers into trash.\r\n	And the tape drives will crumble in a flash.\r\n	Oh, it''s so much fun, When the CPU\r\n	Now the CPU won''t run\r\n	Can print nothing out but "foo,"\r\n		And the system is going to crash.\r\n		The system is going to crash.'),
(79, '"That unit is a woman."\r\n	"A mass of conflicting impulses."\r\n		-- Spock and Nomad, "The Changeling", stardate 3541.9'),
(80, 'Vulcans believe peace should not depend on force.\n		-- Amanda, "Journey to Babel", stardate 3842.3'),
(81, '''Yeah, well, I didn''t sign up for world domination,'' said Medium Dave. ''That sort of thing gets you into trouble.''\n(Hogfather)'),
(82, 'Reality must take precedence over public relations, for Mother Nature\r\ncannot be fooled.\r\n		-- R.P. Feynman'),
(83, '06.026\nWhat can modernity tell those who dislike shopping?'),
(84, 'A great empire, like a great cake, is most easily diminished at the edges.\r\n		-- B. Franklin'),
(85, 'for ARTIFICIAL FLAVORING!!'),
(86, 'To err is human, to forgive is Not Company Policy.'),
(87, 'Q:	What is green and lives in the ocean?\nA:	Moby Pickle.'),
(88, 'Nobody wants constructive criticism.  It''s all we can do to put up with\nconstructive praise.'),
(89, 'Leveraging always beats prototyping.'),
(90, 'I love being married.  It''s so great to find that one special person\nyou want to annoy for the rest of your life.\n		-- Rita Rudner'),
(91, 'Don''t Worry, Be Happy.\r\n		-- Meher Baba'),
(92, 'To fear love is to fear life, and those who fear life are already three\nparts dead.\n		-- Bertrand Russell'),
(93, 'MUZZLER. A violent blow on the mouth. The milling\r\n  cove tipped the cull a muzzler; the boxer gave the fellow\r\n  a blow on the mouth.'),
(94, 'The years of peak mental activity are undoubtedly between the ages of\r\nfour and eighteen. At four we know all the questions, at eighteen all\r\nthe answers.'),
(95, 'Only the fittest survive. The vanquished acknowledge their unworthiness by \nplacing a classified ad with the ritual phrase "must sell -- best offer," \nand thereafter dwell in infamy, relegated to discussing gas mileage and lawn\nfood.  But if successful, you join the elite sodality that spends hours \nunpurifying the dialect of the tribe with arcane talk of bits and bytes, RAMS\nand ROMS, hard disks and baud rates. Are you obnoxious, obsessed?  It''s a \nmodest price to pay.  For you have tapped into the same awesome primal power \nthat produces credit-card billing errors and lost plane reservations.  Hail,\npostindustrial warrior, subduer of Bounceoids, pride of the cosmos, keeper of\nthe silicone creed: Computo, ergo sum.  The force is with you -- at 110 volts.\nMay your RAMS be fruitful and multiply.\n		-- Curt Suplee, "Smithsonian", 4/83'),
(96, 'Tech Support: "Thank you for calling. How can I help you?" \r\n  Customer: "Help!" \r\n  Tech Support: "What''s the problem, sir?" \r\n  Customer: "My drive started making funny noises, so I put my finger in it to \r\n  see what was wrong, and now I CAN''T GET IT OUT!!" \r\nAfter muting the customer for a few seconds to regain his composure, I calmly \r\nsuggested that the man hang up and call 911. The funniest part is that this guy \r\nactually waited on hold for over ten minutes before he was able to reach a tech.'),
(97, 'Truth has always been found to promote the best interests of mankind...\r\n- Percy Bysshe Shelley'),
(98, 'Life, like beer, is merely borrowed.\r\n		-- Don Reed'),
(99, 'Corrupt: In politics, holding an office of trust or profit.'),
(100, 'You know what we can be like:  See a guy and think he''s cute one minute, the\r\nnext minute our brains have us married with kids, the following minute we see\r\nhim having an extramarital affair.  By the time someone says "I''d like you to\r\nmeet Cecil," we shout, "You''re late again with the child support!"\r\n		-- Cynthia Heimel, "A Girl''s Guide to Chaos"'),
(101, 'Thus spake the master programmer:\r\n	"After three days without programming, life becomes meaningless."\r\n		-- Geoffrey James, "The Tao of Programming"'),
(102, 'Dog bites rank second behind sexually transmitted diseases as the most costly health problem in the United States.'),
(103, 'Actually, typing random strings in the Finder does the equivalent of\r\nfilename completion.\r\n(Discussion in comp.os.linux.misc on the intuitiveness of commands: file\r\ncompletion vs. the Mac Finder.)'),
(104, 'Ridcully was to management what King Herod was to the Bethlehem Playgroup\nAssociation. His mental approach to it could be visualised as a sort of\nbusiness flowchart with, at the top, a circle entitled "Me, who does the\ntelling" and, connected below it by a line, a large circle entitled\n"Everyone else".\n(The Last Continent)'),
(105, 'Cole''s Law:\n	Thinly sliced cabbage.'),
(106, '"What do people like to drink here, then?"\nThe landlord looked sideways at his customers, a clever trick given that\nthey were directly in front of him.\n        -- Mort goes out for a drink\n           (Terry Pratchett, Mort)'),
(107, 'Football commentator and former player Joe Theismann: "Nobody in football \r\nshould be called a genius. A genius is a guy like Norman Einstein."'),
(108, 'This fortune is false.'),
(109, 'LADDER. To go up the ladder to rest; to be hanged.'),
(110, 'brokee, n:\n	Someone who buys stocks on the advice of a broker.'),
(111, 'After all, what is your hosts'' purpose in having a party?\r\nSurely not for you to enjoy yourself; if that were their sole\r\npurpose, they''d have simply sent champagne and women over to\r\nyour place by taxi.\r\n\r\n	-- P. J. O''Rourke'),
(112, '... though his invention worked superbly -- his theory was a crock of sewage\nfrom beginning to end.\n		-- Vernor Vinge, "The Peace War"'),
(113, 'Your true value depends entirely on what you are compared with.'),
(114, 'On the road, ZIPPY is a pinhead without a purpose, but never without a\r\nPOINT ...'),
(115, 'The work [of software development] is becoming far easier (i.e. the tools\nwe''re using work at a higher level, more removed from machine, peripheral\nand operating system imperatives) than it was twenty years ago, and because\nof this, knowledge of the internals of a system may become less accessible.\nWe may be able to dig deeper holes, but unless we know how to build taller\nladders, we had best hope that it does not rain much.\n		-- Paul Licker'),
(116, '"His eyes were cold.  As cold as the bitter winter snow that was falling\noutside.  Yes, cold and therefore difficult to chew..."'),
(117, 'Language is a virus from another planet.\r\n	-- William Burroughs'),
(118, 'Tech Support: "Ok, now type ''C D space backslash''." \r\n  Customer: "Um, can you repeat that?" \r\n  Tech Support: "Yes, ''C D space backslash''." \r\n  Customer: "''C P''?" \r\n  Tech Support: "No, ''C D''." \r\n  Customer: "Ok, ''C D slash backspace''." \r\n  Tech Support: "No, ''C D SPACE BACKSLASH''." \r\n  Customer: "''C D slash space backspace''." \r\n  Tech Support: "No, ''C D SPACE BACKSLASH''." \r\n  Customer: "''C D slash backspace''." \r\n  Tech Support: "''C D SPACE BACKSLASH''." \r\n  Customer: "''C D space backslash''."'),
(119, 'HOLBORN HILL. To ride backwards up Holborn hill; to\r\n  go to the gallows: the way to Tyburn, the place of\r\n  execution for criminals condemned in London, was up that\r\n  hill. Criminals going to suffer, always ride backwards,\r\n  as some conceive to increase the ignominy, but more\r\n  probably to prevent them being shocked with a distant view\r\n  of the gallows; as, in amputations, surgeons conceal the\r\n  instruments with which they are going to operate. The\r\n  last execution at Tyburn, and consequently of this\r\n  procession, was in the year 1784, since which the criminals\r\n  have been executed near Newgate'),
(120, 'When I was 6 and my dad brought home one of the world''s first pocket\ncalculators, an HP-35, he tried to convince me that it had a computer inside\nit. I thought that was unlikely. All the computers on Star Trek were the\nsize of a room and had big reel-to-reel tape recorders. I thought that there\nwas just a clever correlation between the keys on the keypad and the\nindividual elements of the LED display that happened to produce\nmathematically correct results. (Hey, I was 6).\n\n	Joel Spolsky\n	"User Interface Design for Programmer - Chapter 2"'),
(121, 'Weiner''s Law of Libraries:\n	There are no answers, only cross references.'),
(122, 'It is better to die on your feet than to live on your knees.'),
(123, 'LSD melts in your mind, not in your hand.'),
(124, 'HOBBERDEHOY. Half a man and half a boy, a lad between\r\n  both.'),
(125, 'Customer: "I have Microscope Exploiter."'),
(126, 'Computer Error Haiku:\r\n\r\nYou seek a Web site.\r\nIt cannot be located.\r\nCountless more exist.'),
(127, 'BUZMAN. A pickpocket. CANT.'),
(128, 'I don''t want to live on in my work, I want to live on in my apartment.\n		-- Woody Allen'),
(129, 'But they went to MARS around 1953!!'),
(130, 'Unix gives you just enough rope to hang yourself -- and then a couple\nof more feet, just to be sure.\n		-- Eric Allman\n\n... We make rope.\n		-- Rob Gingell on Sun Microsystem''s new virtual memory.'),
(131, 'Proverbs 26:16\nThe sluggard is wiser in his own eyes than seven men who answer \ndiscreetly.'),
(132, '08.079\nWe must not pray in order to name ourselves; we must name ourselves in order to\npray.'),
(133, 'Monica: Please tell me you''re stopping now.\n\nPete: I''m fine! I''d fight tonight, if they''d let me. [stands up and starts\nswinging his arms] See this circle I''m marking off here? This is my zone\nof terror.\n\nMonica: You are insane! You-you gotta give this up!\n\nPete: I can''t until I''m the ultimate fighter. I will do it. I''m telling\nyou, the day will come when children will argue over who will win a\nfight, me or Superman. Now, I''m not saying I could beat Superman, but\ny''know, kids are stupid.\n\n\n                              Excerpt from the TV Show "Friends"'),
(134, 'Back in the early 60''s, touch tone phones only had 10 buttons.  Some\nmilitary versions had 16, while the 12 button jobs were used only by people\nwho had "diva" (digital inquiry, voice answerback) systems -- mainly banks.\nSince in those days, only Western Electric  made "data sets" (modems) the\nproblems of terminology were all Bell System.  We used to struggle with\nwritten descriptions of dial pads that were unfamiliar to most people\n(most phones were rotary then.)  Partly in jest, some AT&T engineering\ntypes (there was no marketing in the good old days, which is why they were\nthe good old days) made up the term "octalthorpe" (note spelling) to denote\nthe "pound sign."  Presumably because it has 8 points sticking out.  It\nnever really caught on.'),
(135, 'Computers can figure out all kinds of problems, except the things in\r\nthe world that just don''t add up.'),
(136, 'Talking to a Mac user: \r\n  Tech Support: "Do you have any extensions on?" \r\n  Customer: "I have a surge protector."'),
(137, 'TO TIP. To give or lend. Tip me your daddle; give me\r\n  your hand. Tip me a hog; give me a shilling. To tip\r\n  the lion; to flatten a man''s nose with the thumb, and, at\r\n  the same time to extend his mouth, with the fingers, thereby\r\n  giving him a sort of lion-like countenauce. To tip the\r\n  velvet; tonguing woman. To tip all nine; to knock\r\n  down all the nine pins at once, at the game of bows or\r\n  skittles: tipping, at these gaines, is slightly touching the\r\n  tops of the pins with the bowl. Tip; a draught; don''t\r\n  spoil his tip.'),
(138, 'And the silence came surging softly backwards\r\nWhen the plunging hooves were gone...\r\n		-- Walter de La Mare, "The Listeners"'),
(139, 'You would if you could but you can''t so you won''t.'),
(140, '''You have the right to remain silent,'' he [Carrot] said. ''You have the right not to injure yourself falling down the steps on the way to the cells. You have the right not to jump out of high windows. You do not have to say anything, you see, but anything you do say, well, I have to take it down and it might be used as evidence.''\n(Guards! Guards!)'),
(141, 'PUNY. Weak. A puny child; a weak little child. A\r\n  puny stomach; a weak stomach. Puny, or puisne judge;\r\n  the last made judge.'),
(142, 'That money talks,\r\nI''ll not deny,\r\nI heard it once,\r\nIt said "Good-bye.\r\n		-- Richard Armour'),
(143, 'From a student in America''s fine public school system:\r\n  The fall of empires has been a good thing, because it gives more people a \r\n  chance to exploit their own people without outside interference.'),
(144, 'I came out of twelve years of college and I didn''t even know how to sew.\r\nAll I could do was account -- I couldn''t even account for myself.\r\n		-- Firesign Theatre'),
(145, 'There are strange things done in the midnight sun\r\n	By the men who moil for gold;\r\nThe Arctic trails have their secret tales\r\n	That would make your blood run cold;\r\nThe Northern Lights have seen queer sights,\r\n	But the queerest they ever did see\r\nWas that night on the marge of Lake Lebarge\r\n	I cremated Sam McGee.\r\n		-- Robert W. Service'),
(146, 'A diplomat is a person who can tell you to go to hell in such a way that you\r\nactually look forward to the trip.\r\n		-- Caskie Stinnett, "Out of the Red"'),
(147, 'Brain, v. [as in "to brain"]:\r\nTo rebuke bluntly, but not pointedly; to dispel a source of\r\nerror in an opponent.\r\n\r\n	-- Ambrose Bierce, "The Devil''s Dictionary"'),
(148, 'Proverbs 22:22-23\n22. Do not exploit the poor because they are poor and do not crush \nthe needy in court,\n23. for the LORD will take up their case and will plunder those who \nplunder them.'),
(149, 'I hear and I forget.\r\nI see and I remember.\r\nI do and I understand.\r\n\r\n	-- Confucius'),
(150, '"Kill the Wabbit, Kill the Wabbit, Kill the Wabbit!"\r\n-- Looney Tunes, "What''s Opera Doc?" (1957, Chuck Jones)'),
(151, 'bug, n:\r\n	A son of a glitch.'),
(152, 'Always be sincere, even when you don''t mean it.\r\n\r\n	-- Irene Peter'),
(153, '07.010\nOur perception is a superimposition, which may be guided by Him.'),
(154, 'Example is not the main thing in influencing others.  It is the only thing.\r\n\r\n	-- Albert Schweitzer'),
(155, '1 million-million microphones: 1 megaphone'),
(156, '"The glamorous 17-year-old wants to be a policewoman some day, like her dad." -- From a New Zealand paper.'),
(157, 'HEMP. Young hemp; an appellation for a graceless boy.'),
(158, 'It is no wonder that people are so horrible when they start life as children.\r\n		-- Kingsley Amis'),
(159, 'The end of the world will occur at three p.m., this Friday, with\nsymposium to follow.'),
(160, 'Ways to Have Fun in an Elevator:\r\n26. Walk on with a cooler that says "human head" on the side.\r\n27. Stare at another passenger for a while, then announce "You''re one of\r\n    THEM!" and move to the far corner of the elevator.\r\n28. Burp, and then say "mmmm...tasty!"\r\n29. Leave a box between the doors.\r\n30. Ask each passenger getting on if you can push the button for them.'),
(161, 'PRIG. A thief, a cheat: also a conceited coxcomical\r\n  fellow.'),
(162, 'You could live a better life, if you had a better mind and a better body.'),
(163, 'There''s no room in the drug world for amateurs.'),
(164, 'We are Pentium of Borg. Division is futile. You will be approximated.\r\n(seen in someone''s .signature)'),
(165, 'The truth of a proposition has nothing to do with its credibility.  And\r\nvice versa.'),
(166, 'An apple a day makes 365 apples a year.'),
(167, 'JACK KETCH.  The hangman; vide DERRICK and KETCH.'),
(168, 'QOTD:\r\n	I opened Pandora''s box, let the cat out of the bag and put the\r\n	ball in their court.\r\n		-- Hon. J. Hacker (The Ministry of Administrative Affairs)'),
(169, 'Beware of half-truths - you may have the wrong half.'),
(170, 'A truly wise man never plays leapfrog with a Unicorn.'),
(171, 'The purpose of life is to matter\r\n	to count\r\n	to stand for something\r\n	to have it make some\r\n	difference that we lived at all.\r\n\r\n	-- Leo Rosten'),
(172, 'The motto of the American people, "In God We Trust," was not adopted as the national slogan until 1956.'),
(173, '"Don''t have a cow, Homer!"\r\n\r\n	-- Bart'),
(174, 'The two most common elements in the universe are hydrogen and stupidity.'),
(175, 'The truth is what is; what should be is a dirty lie.\r\n\r\n	-- Lenny Bruce'),
(176, '"Hey, I know you, my daddy took your beer."\n\n	--Ralph Wiggum\n	  This Little Wiggy (Episode 5F13)'),
(177, 'Let''s remind ourselves that last year''s fresh idea is today''s cliche.\n		-- Austen Briggs'),
(178, 'Many receive advice, few profit by it.\n		-- Publilius Syrus'),
(179, 'Carelessly planned projects take three times longer to complete than expected.\r\nCarefully planned projects take four times longer to complete than expected,\r\nmostly because the planners expect their planning to reduce the time it takes.'),
(180, 'Money is a powerful aphrodisiac.  But flowers work almost as well.\r\n		-- Lazarus Long'),
(181, '"We''ll look into it":\n	By the time the wheels make a full turn, we\n	assume you will have forgotten about it, too.'),
(182, 'He that breaks a thing to find out what it is has left the path of wisdom.\r\n		-- J.R.R. Tolkien'),
(183, 'Q:	Where''s the Lone Ranger take his garbage?\nA:	To the dump, to the dump, to the dump dump dump!\n\nQ:	What''s the Pink Panther say when he steps on an ant hill?\nA:	Dead ant, dead ant, dead ant dead ant dead ant...'),
(184, 'How can you expect to govern a country that has two hundred and forty-six kinds\r\nof cheese?\r\n\r\n	-- Charles de Gaulle'),
(185, 'Ice cream doesn''t make us cooler. Because of its high caloric content, it makes one hotter, not cooler.'),
(186, 'War is a form of organic behavior.  The army is a means of survival for the \nall-male group.  The all-female group, on the other hand, is traditionally \nreligion-oriented.  They are the keepers of sacred mysteries.\n\n-Bene Gesserit Teaching'),
(187, 'Don''t despise your poor relations, they may become suddenly rich one day.\n		-- Josh Billings'),
(188, 'If you explain so clearly that nobody can misunderstand, somebody will.'),
(189, 'We is confronted with insurmountable opportunities.\r\n		-- Walt Kelly, "Pogo"'),
(190, 'Going to church does not make a person religious, nor does going to school\nmake a person educated, any more than going to a garage makes a person a car.'),
(191, 'You can''t prevent disasters, but you can diminish their frequency and severity. \n	-- Murphy''s Law of Risk'),
(192, 'There is a company in Taiwan that makes dinnerware out of wheat--so you can eat your plate.'),
(193, 'A conservative is a worshipper of dead radicals.'),
(194, 'It is now pitch dark.  If you proceed, you will likely fall into a pit.'),
(195, 'Experience is something you don''t get until just after you need it.'),
(196, 'A LISP programmer knows the value of everything, but the cost of nothing.\r\n		-- Alan Perlis'),
(197, 'I don''t wanna argue, and I don''t wanna fight,\r\nBut there will definitely be a party tonight...'),
(198, 'Computer Error Haiku:\r\n\r\nYou step in the stream\r\nBut the water has moved on.\r\nPage not found.'),
(199, 'You will remember, Watson, how the dreadful business of the\r\nAbernetty family was first brought to my notice by the depth which the\r\nparsley had sunk into the butter upon a hot day.\r\n		-- Sherlock Holmes'),
(200, '"There are three possibilities: Pioneer''s solar panel has turned away\r\nfrom the sun; there''s a large meteor blocking transmission; or someone\r\nloaded Star Trek 3.2 into our video processor."'),
(201, 'Suggested Improvements to the Documentation:\n\nThe WYSIWYT project was for a long time fascinated by Microsoft''s tremendous \ndesire to advance its Internet Explorer web-browser. We saw the fact that \nthey switched the help systems of the upcoming Windows 98, as well as \nMicrosoft Visual C++ 5.0, to HTML a major step in advancing our project.\n\nAs a complementary step, some of the chief heads of our project suggested\nthat the Windows'' manuals themselves, as well as all of Microsoft''s ads,\nwill be designed in HTML and printed after being rendered by IE4. While this\nproject is in the preliminary and planning stages, we expect it to acquire a\nlarge momentum soon.\n\n	"IRPWUG Announces Project ''WYSIWYT''"\n	Shlomi Fish'),
(202, 'I refuse to consign the whole male sex to the nursery.  I insist on\nbelieving that some men are my equals.\n		-- Brigid Brophy'),
(203, 'Never drink coke in a moving elevator.  The elevator''s motion coupled with\nthe chemicals in coke produce hallucinations.  People tend to change into\nlizards and attack without warning, and large bats usually fly in the\nwindow.  Additionally, you begin to believe that elevators have windows.'),
(204, 'A man was talking to his best friend about his married life.  "You know," he\r\nsays, "I really trust my wife, and I think she has always been faithful to\r\nme, but there''s *always* that doubt.  There''s *always* that little doubt."\r\n	"Yeah, I know what you mean," his friend replies.\r\n	"Well, buddy, I''ve got to leave on a business trip this weekend,\r\nand I wonder... well... would you watch my house while I''m gone?  I trust\r\nher, it''s just that there''s *always* that doubt."\r\n	The friend agreed to help out and two weeks later gave his report.\r\n	"I''ve got some bad news for you," says the friend.  "The evening\r\nafter you left I saw a strange car pull up in front of your house.  A man\r\ngot out of the car and went in the house and had dinner with your wife.\r\nAfter dinner they went upstairs and I saw your wife kissing him.  Then, he\r\ntook off his shirt and she took off her blouse.  And then the light went\r\nout."\r\n	"*Then* what happened?" said the husband, his eyes opening wide.\r\n	"Well, I don''t know," replied the friend, "it was too dark to see."\r\n	"Damn!" roared the husband.  "You see what I mean?  There''s *always*\r\nthat doubt!"'),
(205, 'A young honeymoon couple were touring southern Florida and happened \r\nto stop at one of the rattlesnake farms along the road.  After seeing the \r\nsights, they engaged in small talk with the man that handled the snakes.\r\n"Gosh!" exclaimed the new bride.  "You certainly have a dangerous job.\r\nDon''t you ever get bitten by the snakes?"\r\n	"Yes, upon rare occasions," answered the handler.\r\n	"Well," she continued, "just what do you do when you''re bitten by\r\na snake?"\r\n	"I always carry a razor-sharp knife in my pocket, and as soon as I\r\nam bitten, I make deep criss-cross marks across the fang entry and then\r\nsuck the poison from the wound."\r\n	"What, uh... what would happen if you were to accidentally *sit* on\r\na rattler?" persisted the woman.\r\n	"Ma''am," answered the snake handler, "that will be the day I learn\r\nwho my real friends are."'),
(206, 'Living your life is a task so difficult, it has never been attempted before.'),
(207, 'The horror... the horror!'),
(208, 'Talk sense to a fool and he calls you foolish.\r\n\r\n	-- Euripides'),
(209, '"Maybe we should think of this as one perfect week... where we found each\r\nother, and loved each other... and then let each other go before anyone\r\nhad to seek professional help."'),
(210, 'Oxygen is a very toxic gas and an extreme fire hazard.  It is fatal in\r\nconcentrations of as little as 0.000001 p.p.m.  Humans exposed to the\r\noxygen concentrations die within a few minutes.  Symptoms resemble very\r\nmuch those of cyanide poisoning (blue face, etc.).  In higher\r\nconcentrations, e.g. 20%, the toxic effect is somewhat delayed and it\r\ntakes about 2.5 billion inhalations before death takes place.  The reason\r\nfor the delay is the difference in the mechanism of the toxic effect of\r\noxygen in 20% concentration.  It apparently contributes to a complex\r\nprocess called aging, of which very little is known, except that it is\r\nalways fatal.\r\n\r\nHowever, the main disadvantage of the 20% oxygen concentration is in the\r\nfact it is habit forming.  The first inhalation (occurring at birth) is\r\nsufficient to make oxygen addiction permanent.  After that, any\r\nconsiderable decrease in the daily oxygen doses results in death with\r\nsymptoms resembling those of cyanide poisoning.\r\n\r\nOxygen is an extreme fire hazard.  All of the fires that were reported in\r\nthe continental U.S. for the period of the past 25 years were found to be\r\ndue to the presence of this gas in the atmosphere surrounding the buildings\r\nin question.\r\n\r\nOxygen is especially dangerous because it is odorless, colorless and\r\ntasteless, so that its presence can not be readily detected until it is\r\ntoo late.\r\n		-- Chemical & Engineering News February 6, 1956'),
(211, 'It is by the fortune of God that, in this country, we have three benefits:\r\nfreedom of speech, freedom of thought, and the wisdom never to use either.\r\n		-- Mark Twain'),
(212, 'Up the airy mountains, down the rushy glen...\nFrom ghosties and bogles and long-leggity beasties...\nMy mother said I never should...\nWe dare not go a-hunting for fear...\nAnd things that go bump...\nPlay with the fairies in the wood...\n(Lords and Ladies)'),
(213, 'What gets you promoted from one rank gets you killed in the next rank\n		-- Murphy''s New Military Laws nÂ°17'),
(214, 'COFFEE IS NOT FOR KIDS\nCOFFEE IS NOT FOR KIDS\nCOFFEE IS NOT FOR KIDS\nCOFFEE IS NOT FOR KIDS\n\n	Bart Simpson on chalkboard in episode 9F09'),
(215, '09.030\nExtremism: just say know.'),
(216, 'When people say nothing, they don''t necessarily mean nothing.'),
(217, 'Her days were spent in a kind of slow bustle; always busy without getting\non, always behind hand and lamenting it, without altering her ways;\nwishing to be an economist, without contrivance or regularity; dissatisfied\nwith her servants, without skill to make them better, and whether helping, or\nreprimanding, or indulging them, without any power of engaging their respect.\n		-- J. Austen'),
(218, 'After the Children of Israel had wandered for thirty-nine years\nin the wilderness, Ferdinand Feghoot arrived to make sure that they would\nfinally find and enter the Promised Land.  With him, he brought his\nfavorite robot, faithful old Yewtoo Artoo, to carry his gear and do\nassorted camp chores.\n	The Israelites soon got over their initial fear of the robot and,\nas the months passed, became very fond of him.  Patriarchs took to\ndiscussing abtruse theological problems with him, and each evening the\nchildren all gathered to hear the many stories with which he was programmed.\nTherefore it came as a great shock to them when, just as their journey was\nending, he abruptly wore out.  Even Feghoot couldn''t console them.\n	"It may be true, Ferdinand Feghoot," said Moses, "that our friend\nYewtoo Artoo was soulless, but we cannot believe it.  He must be properly\ninterred.  We cannot embalm him as do the Egyptians.  Nor have we wood for\na coffin.  But I do have a most splendid skin from one of Pharoah''s own\ncattle.  We shall bury him in it."\n	Feghoot agreed.  "Yes, let this be his last rusting place."\n	"Rusting?" Moses cried.  "Not in this dreadful dry desert!"\n	"Ah!" sighed Ferdinand Feghoot, shedding a tear, "I fear you do not\nrealize the full significance of Pharoah''s oxhide!"\n		-- Grendel Briarton "Through Time & Space With Ferdinand\n		   Feghoot!"'),
(219, 'I received a call from the PA to the Finance Director, (the owner of 28% of our \r\ntech support calls for that year). She reported that one of her floppy disks had \r\ncaused our virus checker to flash a very alarming message. I asked her to put \r\nthe disk to one side until I arrived. When I made it to her office, I was \r\ndirected to a corner desk where a disk box had been set up with a yellow post-it \r\nnote reading "Quarantine." She explained she had put the disk in this separate \r\ndisk box so it wouldn''t infect the other floppies.'),
(220, 'QOTD:\n	If you''re looking for trouble, I can offer you a wide selection.'),
(221, 'HOW TO PROVE IT, PART 6\r\n\r\nproof by picture:\r\n	A more convincing form of proof by example. Combines well \r\n	with proof by omission.\r\n\r\nproof by vehement assertion:\r\n	It is useful to have some kind of authority relation to the \r\n	audience.\r\n\r\nproof by ghost reference:\r\n	Nothing even remotely resembling the cited theorem appears in \r\n	the reference given.'),
(222, 'panic: can''t find /'),
(223, 'Action may not always be happiness, but there is no happiness without action.'),
(224, 'Think of it! With VLSI we can pack 100 ENIACs in 1 sq. cm.!'),
(225, 'Proverbs 15:2\nThe tongue of the wise commends knowledge, but the mouth of the fool \ngushes folly.'),
(226, 'KITTYS. Effects, furniture; stock in trade. To seize one''s\r\n  kittys; to take his sticks.'),
(227, '"Yes, and I feel bad about rendering their useless carci into dogfood..."\r\n-- Badger comics'),
(228, 'DILBERRIES. Small pieces of excrement adhering to the\r\n  hairs near the fundament.'),
(229, 'Education is going to college to learn to express your ignorance in scientific \nterms.'),
(230, 'Clear the laundromat!!  This whirl-o-matic just had a nuclear meltdown!!'),
(231, 'Bats do not navigate by radar. It''s sonarâwhich involves sound waves as opposed to radar which has to do with electronic waves.'),
(232, 'The UNIX philosophy basically involves giving you enough rope to\r\nhang yourself.  And then a couple of feet more, just to be sure.'),
(233, 'A conference is just an admission that you want somebody to join you in your\r\ntroubles\r\n	-- Will Rogers'),
(234, 'I''m a geek with a journalism degree. I suppose that makes me overqualified\nfor a job with ZDNet. Darn. \n\n   -- From a Slashdot.org post'),
(235, 'BISHOP. A mixture of wine and water, into which is put a\r\n  roasted orange. Also one of the largest of Mrs. Philips''s\r\n  purses, used to contain the others.'),
(236, '"No proper program contains an indication which as an operator-applied\r\noccurrence identifies an operator-defining occurrence which as an\r\nindication-applied occurrence identifies an indication-defining\r\noccurrence different from the one identified by the given indication as\r\nan indication-applied occurrence."\r\n\r\n	-- ALGOL 68 Report'),
(237, 'I''m a fuschia bowling ball somewhere in Brittany'),
(238, 'The eye in the end of a lariat is called a "honda."'),
(239, '"Am I cold? Why do you think I''m sitting here under these two Africans?" -- An elderly lady, incredulously, during a televised interview at her home.'),
(240, 'Imagine what we can imagine!\r\n		-- Arthur Rubinstein'),
(241, 'Everything should be built top-down, except the first time.'),
(242, 'MOTHER-IN-LAW PROBLEMS\r\nJohn was in a bar looking very dejected. His friend, Steve, walked over and asked, "What''s wrong?" "It''s my mother-in-law," John replied, shaking his head, sadly. "I have a real problem with her." "Cheer up," Steve said. "Everyone has problems with their mother-in-law." "Yeah," John answered. "But I got mine pregnant."'),
(243, 'Wonder is the feeling of a philosopher, and philosophy begins in wonder.\n		-- Socrates, quoting Plato\n	[Huh?  That''s like Johnson quoting Boswell]'),
(244, 'Better late than never.\r\n		-- Titus Livius (Livy)'),
(245, '"Nuclear war would really set back cable."\r\n		-- Ted Turner'),
(246, 'CANARY BIRD. A jail bird, a person used to be kept in\r\n  a cage; also, in the canting sense, guineas.'),
(247, 'We wish to attract praise to ourselves even as we seem to be\r\npraising others.\r\n\r\n	-- Duc de La Rochefoucauld'),
(248, 'Women reason with the heart and are much less often wrong than men who\r\nreason with the head.\r\n		-- DeLescure'),
(249, 'You should never wear your best trousers when you go out to\r\nfight for freedom and liberty.\r\n\r\n	-- Henrick Ibson'),
(250, 'Proverbs 28:23\nHe who rebukes a man will in the end gain more favor than he who has \na flattering tongue.'),
(251, 'For an idea to be fashionable is ominous, since it must afterwards be\nalways old-fashioned.'),
(252, 'Latin is a language,\nAs dead as can be.\nFirst it killed the Romans,\nAnd now it''s killing me.'),
(253, 'There is a green, multi-legged creature crawling on your\r\nshoulder.'),
(254, 'I recently visited the site of a company which shall remain unnamed and was \r\nfrustrated by the extremely slow screen refresh as I scrolled through the page. \r\nI investigated and discovered that instead of declaring a plain green background \r\ncolor for the page, they had created a one pixel GIF image which was ''tiled'' as \r\na background.'),
(255, 'Put no trust in cryptic comments.'),
(256, 'Support wildlife -- vote for an orgy.'),
(257, 'If there is no God, who pops up the next Kleenex?\r\n\r\n	-- Art Hoppe'),
(258, 'Then I learned to play some lead guitar\nI was underage in this funky bar\nAnd I stepped outside to smoke myself a "J"\nAnd when I came back to the room\nEverybody just seemed to move\nAnd I turned my amp up loud and I began to play\nAnd it was late in the evening\nAnd I blew that room away\n\n- as sung by Paul Simon "Late In The Evening"'),
(259, 'Morality\n\n   Bodhidharma ... far transcends moralists, puritans, so-called good\n   people, do-gooders. He has touched the very rock bottom of the\n   problem. Unless awareness arises in you, all your morality is bogus,\n   all your culture is simply a thin layer which can be destroyed by\n   anybody. But once your morality has come out of your awareness, not\n   out of a certain discipline, then it is a totally different matter.\n   Then you will respond in every situation out of your awareness. And\n   whatever you do will be good.\n   Awareness cannot do anything that is bad. That is the ultimate beauty\n   of awareness, that anything that comes out of it is simply beautiful,\n   is simply right, and without any effort and without any practice. So\n   rather than cutting the leaves and the branches, cut the root. And to\n   cut the root there is no other method than a single method: the method\n   of being alert, of being aware, of being conscious.\n\n                     Osho Bodhidharma, The Greatest Zen Master Chapter 15'),
(260, 'What do Jose Offerman and Michael Jackson have in common?\r\n\r\nThey both wear a glove for no apparent reason.');
INSERT INTO `av_quotes` (`ID`, `quote`) VALUES
(261, 'CONDOMS GROWING ON TREES IN SAFE SEX PUSH\r\n(Australia) A health service in Western Australia''s Kimberley region has come up with an innovative way of promoting safe sex in Aboriginal communities. The program provides free condoms at unusual outdoor locations. Posters around Fitzroy Crossing advertise "Free Condoms in a Tree Near You." Under the program, canisters of condoms are hung from trees where different Aboriginal language groups traditionally gather. Patrick Davies from the Nindin-lin-gaari Cultural Health Center says the idea follows concern over the high rate of sexually transmitted diseases. He says previously people were embarrassed about getting condoms from the only outlets in townâthe hospital or the news agency. "We were able to target the people from outlying communities when they came into town by hanging these PVC containers under those treesâthey take about 2,500 or 3,000 every month," he said.'),
(262, 'Gray Matter\r\nOlder, experienced business people hired by young entrepreneurial firms looking to appear more reputable and established.'),
(263, 'The average person inadvertently swallows eight spiders a year.'),
(264, 'Dear Freshman,\r\n	You don''t know who I am and frankly shouldn''t care, but\r\nunknown to you we have something in common.  We are both rather\r\nprone to mistakes.  I was elected Student Government President by\r\nmistake, and you came to school here by mistake.'),
(265, 'Deadwood, n.:\n	Anyone in your company who is more senior than you are.'),
(266, '10.087\nNo-one is suited to tariqa. Tariqa is suited to everyone.'),
(267, 'The name of the horse that played Mister Ed on TV was "Bamboo Harvester."'),
(268, 'Put another password in,\r\nBomb it out, then try again.\r\nTry to get past logging in,\r\nWe''re hacking, hacking, hacking.\r\n\r\nTry his first wife''s maiden name,\r\nThis is more than just a game.\r\nIt''s real fun, but just the same,\r\nIt''s hacking, hacking, hacking.\r\n		-- To the tune of "Music, Music, Music?"'),
(269, 'All men profess honesty as long as they can.  To believe all men honest\r\nwould be folly.  To believe none so is something worse.\r\n		-- John Quincy Adams'),
(270, 'All syllogisms have three parts, therefore this is not a syllogism.'),
(271, 'A man would still do something out of sheer perversity - he would create\r\ndestruction and chaos - just to gain his point... and if all this could in\r\nturn be analyzed and prevented by predicting that it would occur, then man\r\nwould deliberately go mad to prove his point.\r\n		-- Feodor Dostoevsky, "Notes From the Underground"'),
(272, 'How do you make a small fortune in Texas oil?\r\n\r\nStart with a big one.'),
(273, 'It is sweet to let the mind unbend on occasion.\r\n		-- Quintus Horatius Flaccus (Horace)'),
(274, 'FLIGHT DELAY\r\nA doctor and a Baptist minister were seated next to each other on a plane. The plane was delayed due to technical problems. Just after taking off, the pilot offered his apologies to the passengers and announced that a round of free drinks would be served. When the hostess came round with the trolley, the doctor ordered a gin and tonic. The hostess then asked the minister whether he wanted anything. He replied, "Oh, no thank you. I would rather commit adultery than drink alcohol." The doctor promptly handed his gin and tonic back to the hostess said, "Madam, I didn''t know there was a choice."'),
(275, 'The cost of living is going up, and the chance of living is going\r\ndown.'),
(276, 'All that glitters is not gold; all that wander are not lost.'),
(277, 'CCI Power 6/40: one board, a megabyte of cache, and an attitude...'),
(278, 'In military contracts, a pencil is called a "portable, hand-held communications inscriber."'),
(279, 'To sin by silence when they should protest makes cowards out of men.\r\n\r\n	-- Abraham Lincoln'),
(280, 'Proverbs 24:15-16\n15. Do not lie in wait like an outlaw against a righteous man''s \nhouse, do not raid his dwelling place;\n16. for though a righteous man falls seven times, he rises again, but \nthe wicked are brought down by calamity.'),
(281, 'USED UP. Killed: a military saying, originating from a\r\n  message sent by the late General Guise, on the expedition\r\n  at Carthagena, where he desired the commander in chief\r\n  to order him some more grenadiers, for those he had were\r\n  all used up.'),
(282, 'Do not despair of life.  You have no doubt force enough to overcome your\r\nobstacles.  Think of the fox prowling through wood and field in a winter night\r\nfor something to satisfy his hunger.  Notwithstanding cold and hounds and\r\ntraps, his race survives.  I do not believe any of them ever committed suicide.\r\n		-- Henry David Thoreau'),
(283, 'We must die because we have known them.\r\n		-- Ptah-hotep, 2000 B.C.'),
(284, 'In America, any boy may become president and I suppose that''s just one\nof the risks he takes.\n		-- Adlai Stevenson'),
(285, '"What terrible way to die."\r\n"There are no good ways."\r\n\r\n	-- Sulu and Kirk, "That Which Survives", stardate unknown'),
(286, 'Give me the Luxuries, and the Hell with the Necessities!'),
(287, '03.070\nPessimism is part of the impiety of the periphery.'),
(288, 'GAME. Bubbles or pigeons drawn in to be cheated. Also,\r\n  at bawdy-houses, lewd women. Mother have you any\r\n  game; mother, have you any girls? To die game; to\r\n  suffer at the gallows without shewing any signs of fear or\r\n  repentance. Game pullet; a young whore, or forward\r\n  girl in the way of becoming one.'),
(289, 'The essence of mathematics lies in its freedom.\n                -- Georg Cantor'),
(290, 'The introduction of numbers as coordinates ... is an act of violence...\n                  -- H. Weyl, Philosophy of Mathematics and Natural Science\n                     1949'),
(291, 'One good thing about music,\nWell, it helps you feel no pain.\nSo hit me with music;\nHit me with music now.\n		-- Bob Marley, "Trenchtown Rock"'),
(292, 'Most people are too busy to have time for anything important.'),
(293, 'Indifference will certainly be the downfall of mankind, but who cares?'),
(294, 'I WILL NOT CHARGE ADMISSION TO THE BATHROOM\nI WILL NOT CHARGE ADMISSION TO THE BATHROOM\nI WILL NOT CHARGE ADMISSION TO THE BATHROOM\nI WILL NOT CHARGE ADMISSION TO THE BATHROOM\n\n	Bart Simpson on chalkboard in episode 9F19'),
(295, 'We are all born mad.  Some remain so.\r\n		-- Samuel Beckett'),
(296, '"And so we say goodbye to our beloved pet, Nibbler, who''s gone to a place\nwhere I too hope one day to go: the toilet." \n	-Prof. Farnsworth'),
(297, 'NO CATCHY NO HAVY. If I am not caught, I cannot be hurt.\r\n  Negro saying.'),
(298, 'Build a system that even a fool can use, and only a fool will want to use it\n		-- Educational Considerations nÂ°2'),
(299, 'BTW, for an editor with no replace feature (at least not on Windows 95), \nno regular-expression search and replace, no indentation support, \nno syntax-highlighting and no macros and scriptability features: \nMS Notepad is one hell of an editor!\n\n	"Wonderous are the ways of Microsoft"\n	Shlomi Fish'),
(300, 'GIBBERISH. The cant language of thieves and gypsies,\r\n  called Pedlars'' French, and St. Giles''s Greek: see ST.\r\n  GILES''S GREEK. Also the mystic language of Geber,\r\n  used by chymists. Gibberish likewise means a sort of\r\n  disguised language, formed by inserting any consonant\r\n  between each syllable of an English word; in which case it\r\n  is called the gibberish of the letter inserted: if F, it is the\r\n  F gibberish; if G, the G gibberish; as in the sentence\r\n  How do you do? Howg dog youg dog.'),
(301, '09.033\nIn practice, `remembering God'' can only mean `remembering the Covenant.'''),
(302, '"He expanded his chest to make it totally clear that here \nwas the sort of man you only dared to cross if you had a \nteam of Sherpas with you. "'),
(303, 'War over! Balls thoroughly licked.'),
(304, 'CRAPS\r\nTwo bored casino dealers are waiting at a craps table. A very attractive lady comes in and wants to bet $20,000 on a single roll of the dice. She says, "I hope you don''t mind, but I feel much luckier when I''m topless." With that, she takes off her blouse and rolls the dice. She then begins jumping up and down and hugging and kissing each of the dealers. "Yes! I win! I win!" With that, she picks up her money and clothes and quickly leaves. The dealers just stare at each other dumbfounded. Finally one of them asks, "What did she roll anyway?" The other answers, "I don''t know! I thought YOU were watching!"'),
(305, 'Slang is language that takes off its coat, spits on its hands, and goes\r\nto work.'),
(306, 'Try not to have a good time ... This is supposed to be educational.\r\n\r\n	-- Charles Schulz'),
(307, 'All men are idiots...and I married their king.'),
(308, 'The Rabbits				The Cow\nHere is a verse about rabbits		The cow is of the bovine ilk;\nThat doesn''t mention their habits.	One end is moo, the other, milk.\n		-- Ogden Nash'),
(309, 'The main problem I have with cats is, they''re not dogs.\n		-- Kevin Cowherd'),
(310, 'There are approximately 10 million bricks in the Empire State Building.'),
(311, 'Crickets do not chirp by rubbing their legs together. They rub their wings.'),
(312, 'I see gr-reat changes takin'' place ivry day,\r\nbut no change at all ivry fifty years.\r\n\r\n	-- Finley Peter Dunne'),
(313, 'Few things are harder to put up with than the annoyance of a good example.\n		-- "Mark Twain, Pudd''nhead Wilson''s Calendar"'),
(314, 'QOTD:\r\n	"Overweight is when you step on your dog''s tail and it dies."'),
(315, '"If we were meant to fly, we wouldn''t keep losing our luggage."'),
(316, 'Carswell''s Corollary:\n	Whenever man comes up with a better mousetrap,\n	nature invariably comes up with a better mouse.'),
(317, '"...my father is the Emperor of Klatch and my mother is a small tray of\nraspberry puddings."\n        -- Agnes tells Christine about herself\n           (Terry Pratchett, Maskerade)'),
(318, 'SPICE ISLANDS. A privy. Stink-hole bay or dilberry creek.\r\n  The fundament.'),
(319, '"Ain''t that something what happened today.  One of us got traded to\nKansas City."\n		-- Casey Stengel, informing outfielder Bob Cerv he''d\n		   been traded.'),
(320, 'Q:	Why did the lone ranger kill Tonto?\r\nA:	He found out what "kimosabe" really means.'),
(321, 'Every night my prayers I say,\r\n	And get my dinner every day;\r\nAnd every day that I''ve been good,\r\n	I get an orange after food.\r\nThe child that is not clean and neat,\r\n	With lots of toys and things to eat,\r\nHe is a naughty child, I''m sure--\r\n	Or else his dear papa is poor.\r\n		-- Robert Louis Stevenson'),
(322, 'Type louder, please.'),
(323, 'The minimum number of holes in the case through which fingers,\nscrewdrivers (either metallic or liquid), EMI or earwigs can crawl\nis to be desired.\n		-- Jef Raskin, May 1979\n		   Describing the prototype to later become the\n		   Macintosh'),
(324, 'Homer:	I''m just a big fool.\n\nKarl:	Oh no, you''re not!\n\nHomer:	How do you know?\n\nKarl:	Because my mother taught me never to kiss a fool!\n\n		   Simpson and Delilah'),
(325, 'LURCHED.  Those who lose a game of whist, without scoring five,\r\n  are said to be lurched.'),
(326, 'UNDER OATH\r\n    "You seem to have more than the average share of intelligence for a man of \r\n    your background," sneered the lawyer at a witness on the stand. "If I wasn''t \r\n    under oath, I''d return the compliment," replied the witness.'),
(327, 'Charm is a way of getting the answer "Yes" -- without having asked any\nclear question.'),
(328, 'Your lover will never wish to leave you.'),
(329, 'Practice is the best of all instructors.\r\n- Publilius'),
(330, 'A eunuch can''t grow a beard.'),
(331, 'But, Mousie, thou art no thy lane,\nIn proving foresight may be vain:\nThe best laid schemes o'' mice an'' men\nGang aft a-gley,\nAn'' lea''e us nought but grief and pain\nFor promised joy.\n	-- Robert Burns, "To a Mouse", 1785'),
(332, 'I want to marry a girl just like the girl that married dear old dad.\n		-- Freud'),
(333, 'Bucy''s Law:\r\nNothing is ever accomplished by a reasonable man.'),
(334, 'SOLDIER. A red herring.'),
(335, 'Surprise!  You are the lucky winner of random I.R.S. Audit!  Just type\nin your name and social security number.  Please remember that leaving\nthe room is punishable under law:\n\nName\n#'),
(336, 'Breakthrough\n\nTo transform breakdowns into breakthroughs is the whole function of a master. The psychotherapist simply patches you up. That is his function. He is not there to transform you. You need a meta-psychology, the psychology of the buddhas.\n\nIt is the greatest adventure in life to go through a breakdown consciously. It is the greatest risk because there is no guarantee that the breakdown will become a breakthrough. It does become, but these things cannot be guaranteed. Your chaos is very ancient - for many, many lives you have been in chaos. It is thick and dense. It is almost a universe in itself. So when you enter into it with your small capacity, of course there is danger. But without facing this danger nobody has ever become integrated, nobody has ever become an individual, indivisible.\n\nZen, or meditation, is the method which will help you to go through the chaos, through the dark night of the soul, balanced, disciplined, alert. The dawn is not far away, but before you can reach the dawn, the dark night has to be passed through. And as the dawn comes closer, the night will become darker.\n\n				Osho Walking in Zen, Sitting in Zen Chapter 1'),
(337, 'A hypothetical paradox:\n	What would happen in a battle between an Enterprise security team,\n	who always get killed soon after appearing, and a squad of Imperial\n	Stormtroopers, who can''t hit the broad side of a planet?\n		-- Tom Galloway'),
(338, 'Over the exit of the Arrakeen landing field, crudely carved as though with a \npoor instrument, there was an inscription that Muad''Dib was to repeat many \ntimes. He saw it that first night on Arrakis, having been brought to the ducal \ncommand post to participate in his father''s first full staff conference. The \nwords of the inscription were a plea to those leaving Arrakis, but they fell \nwith dark import on the eyes of a boy who had just escaped a close brush with \ndeath. They said: "O you who know what we suffer here, do not forget us in your \nprayers. "\n\n-from "Manual of Muad''Dib" by the Princess Irulan'),
(339, '"So", Randy continued,"to get back to where we started, the Information Superhighway is a bad metaphor for the internet, because I say it is. There might be a thousand people on the planet who are as conversant with the Internet as I am. I know most of these people. None of them takes that metaphor seriously. Q.E.D."\n"Oh. I see", Kivistik said, a little hotly. He had seen an opening. "So we should rely on the technocrats to tell us what to think, and how to think, about this technology?"\nThe expressions of the others seemed to say that this was a telling blow, righteously struck.'),
(340, '"A woman, like a good piece of music,\r\nshould have a solid end."\r\n\r\n	-- F. Schubert'),
(341, 'Diplomat: an unwise thing to call "Knuckles" Lomat.'),
(342, 'My life has a superb cast but I can''t figure out the plot.\r\n\r\n	-- Ashleigh Brilliant'),
(343, 'Last guys don''t finish nice.\r\n		-- Stanley Kelley, on the cult of victory at all costs'),
(344, 'QOTD:\n	"I haven''t come far enough, and don''t call me baby."'),
(345, 'I sent a letter to the fish,		I said it very loud and clear,\nI told them, "This is what I wish."	I went and shouted in his ear.\nThe little fishes of the sea,		But he was very stiff and proud,\nThey sent an answer back to me.		He said "You needn''t shout so loud."\nThe little fishes'' answer was		And he was very proud and stiff,\n"We cannot do it, sir, because..."	He said "I''ll go and wake them if..."\nI sent a letter back to say		I took a kettle from the shelf,\nIt would be better to obey.		I went to wake them up myself.\nBut someone came to me and said		But when I found the door was locked\n"The little fishes are in bed."		I pulled and pushed and kicked and\n						knocked,\nI said to him, and I said it plain	And when I found the door was shut,\n"Then you must wake them up again."	I tried to turn the handle, But...\n\n	"Is that all?" asked Alice.\n	"That is all." said Humpty Dumpty. "Goodbye."'),
(346, 'The Panama Canal does not cross the Isthmus east to west. Actually, it starts by going south, then takes a turn eastward. Its "western" or Pacific end is actually more than 20 miles east of its Atlantic beginnings.'),
(347, 'QOTD:\n	"Our parents were never our age."'),
(348, 'Valerie: Aww, Tom, you''re going maudlin on me ...\r\nTom:	 I reserve the right to wax maudlin as I wane eloquent ...\r\n\r\n	-- Tom Chapin'),
(349, 'Like the ski resort of girls looking for husbands and husbands looking\nfor girls, the situation is not as symmetrical as it might seem.\n		-- Alan McKay'),
(350, 'KNIGHT OF THE BLADE. A bully.'),
(351, 'The Creator\n\nThere are two types of creators in the world. One type of creator works with objects - a poet, a painter, they work with objects, they create things. The other type of creator, the mystic, creates himself. He doesn''t work with objects, he works with the subject; he works on himself, his own being. And he is the real creator, the real poet, because he makes himself into a masterpiece.\n\nYou are carrying a masterpiece hidden within you, but you are standing in the way. Just move aside, then the masterpiece will be revealed. Everyone is a masterpiece, because God never gives birth to anything less than that. Everyone carries that masterpiece hidden for many lives, no knowing who they are and just trying on the surface to become someone.\n\nDrop the idea of becoming someone, because you are already a masterpiece. You cannot be improved. You have only to come to it, to know it, to realize it. God himself has created you; you cannot be improved.\n\n							Osho Ah, This! Chapter 1'),
(352, 'X windows:\r\n	You''d better sit down.\r\n	Don''t laugh.  It could be YOUR thesis project.\r\n	Why do it right when you can do it wrong?\r\n	Live the nightmare.\r\n	Our bugs run faster.\r\n	When it absolutely, positively HAS to crash overnight.\r\n	There ARE no rules.\r\n	You''ll wish we were kidding.\r\n	Everything you never wanted in a window system.  And more.\r\n	Dissatisfaction guaranteed.\r\n	There''s got to be a better way.\r\n	The next best thing to keypunching.\r\n	Leave the thrashing to us.\r\n	We wrote the book on core dumps.\r\n	Even your dog won''t like it.\r\n	More than enough rope.\r\n	Garbage at your fingertips.\r\n\r\nIncompatibility.  Shoddiness.  Uselessness.\r\n	X windows.'),
(353, 'COW-HANDED. Awkward.'),
(354, 'Ehrman''s Commentary:\r\n	(1) Things will get worse before they get better.\r\n	(2) Who said things would get better?'),
(355, '"Principal Skinner is an old man who lives at the school."\n\n	--Ralph Wiggum\n	  The Principal and the Pauper (Episode 4F23)'),
(356, 'Donut man: Hey, what gives? These donuts are piling up.\r\nWorker: Heh. Yeah, Homer Simpson went on a diet.\r\nDonut man: Oh my God. And I just bought a boat! [slaps forehead]\r\n	-- Homer''s diet depresses the local economy, "Brush with\r\n	 Greatness"'),
(357, 'Does a good farmer neglect a crop he has planted?\nDoes a good teacher overlook even the most humble student?\nDoes a good father allow a single child to starve?\nDoes a good programmer refuse to maintain his code?\n		-- Geoffrey James, "The Tao of Programming"'),
(358, '"What is wanted is not the will to believe, but the will to find out, which is\r\nthe exact opposite."\r\n-- Bertrand Russell, _Sceptical_Essays_, 1928'),
(359, 'Hi there!  This is just a note from me, to you, to tell you, the person\nreading this note, that I can''t think up any more famous quotes, jokes,\nnor bizarre stories, so you may as well go home.'),
(360, 'You''ll feel much better once you''ve given up hope.'),
(361, 'EAT. To eat like a beggar man, and wag his under jaw; a\r\n  jocular reproach to a proud man. To eat one''s words; to\r\n  retract what one has said.'),
(362, 'My homework was not stolen by a one-armed man.\r\n\r\n	-- Bart Simpson - on the blackboard'),
(363, 'Sin boldly.\r\n		-- Martin Luther'),
(364, 'A gift of flower will soon be made to you.'),
(365, 'To find a friend one must close one eye; to keep him -- two.\n		-- Norman Douglas'),
(366, 'Life only demands from you the strength you possess.\r\nOnly one feat is possible -- not to have run away.\r\n		-- Dag Hammarskjold'),
(367, 'You have had a long-term stimulation relative to business.'),
(368, 'LOW, LOW PRICES\r\nA man walks into a bar one night. He goes up to the bar and asks for a beer. "Certainly, sir, that''ll be one cent." "One cent?" exclaims the guy. The barman says, "Yes." So the guy glances over at the menu, and he asks, "Could I have a juicy steak with chips, peas and a fried egg?" "Certainly sir," replies the bartender, "That''ll be four cents." "Four cents?" exclaims the guy. "Where''s the guy who owns this place?" The barman replies, "Upstairs with my wife." The guy says, "What''s he doing with your wife?" The bartender replies, "Same as I''m doing to his business."'),
(369, 'SALMON-GUNDY. Apples, onions, veal or chicken, and\r\n  pickled herrings, minced fine, and eaten with oil and\r\n  vinegar; some derive the name of this mess from the\r\n  French words SELON MON GOUST, because the proportions of\r\n  the different ingredients are regulated by the palate of the\r\n  maker; others say it bears the name of the inventor, who\r\n  was a rich Dutch merchant; but the general and most\r\n  probable opinion is, that it was invented by the countess\r\n  of Salmagondi, one of the ladies of Mary de Medicis, wife\r\n  of King Henry IV. of France, and by her brought into\r\n  France.'),
(370, 'Every country has the government it deserves.\r\n		-- Joseph De Maistre'),
(371, 'Gratitude, like love, is never a dependable international emotion.\n		-- Joseph Alsop'),
(372, '''The gods,'' he said. ''Imprisoned in a thought. And perhaps they were never more than a dream.''\n(Sourcery)'),
(373, 'Men never make passes at girls wearing glasses.\n		-- Dorothy Parker'),
(374, 'Jo Sheldon: "A brain Scan revealed that Andrew Caddick is not suffering from \r\nstress fracture of the shin."'),
(375, 'Peanut Blossoms\r\n\r\n4 cups sugar           16 tbsp. milk\r\n4 cups brown sugar     4 tsp. vanilla\r\n4 cups shortening      14 cups flour\r\n8 eggs                 4 tsp. soda\r\n4 cups peanut butter   4 tsp. salt\r\n\r\nShape dough into balls.  Roll in sugar and bake on ungreased cookie\r\nsheet at 375 F. for 10-12 minutes.  Immediately top each cookie with a\r\nHershey''s kiss or star pressing down firmly to crack cookie.  Makes a\r\nheck of a lot.'),
(376, '... ich bin in einem dusenjet ins jahr 53 vor chr ... ich lande im\r\nantiken Rom ...  einige gladiatoren spielen scrabble ... ich rieche\r\nPIZZA ...'),
(377, 'You can''t buy happiness - but at least if you have money you can be miserable in\r\ncomfort.'),
(378, 'It isn''t easy being the parent of a six-year-old.  However, it''s a pretty small\nprice to pay for having somebody around the house who understands computers.'),
(379, 'Euphemisms for calling someone stupid:\r\n  Somebody lend her a quarter to buy a clue.\r\n  Someone blew out his pilot light.\r\n  Sort of like an inverse Einstein.\r\n  Suffers from Clue Deficit Disorder.\r\n  Surfing in Nebraska.\r\n  Takes her two hours to watch 60 Minutes.\r\n  Teflon brain--nothing sticks.\r\n  The cheese slid off his cracker.'),
(380, 'After living in New York, you trust nobody, but you believe everything.\r\nJust in case.'),
(381, 'Coach "Bear" Bryant: "Who in the hell is that?" \nHigh School Coach: "That there is Forrest Gump, coach - \nJust the local idiot"'),
(382, 'Yow!  Am I having fun yet?'),
(383, 'Seleznick''s Theory of Holistic Medicine:\r\n	Ice Cream cures all ills.  Temporarily.'),
(384, '"Oh, are you going to drive there?" -- Asked repeatedly of a couple moving to Iceland.'),
(385, '04.075\nWrath is finite; mercy knows no end.'),
(386, 'Brooke''s Law:\r\n	Whenever a system becomes completely defined, some damn fool\r\n	discovers something which either abolishes the system or\r\n	expands it beyond recognition.'),
(387, '10.090\n`Equality is not the means to achieve equality.'' (Joan Scott)'),
(388, 'A fool and his money are soon partying.'),
(389, 'Tourists\r\nPeople who are taking training classes just to get a vacation from their jobs. "We had about three serious students in the class; the rest were tourists."'),
(390, 'It is illegal to drive more than two thousand sheep down Hollywood\r\nBoulevard at one time.'),
(391, 'Q:	How do you stop an elephant from charging?\r\nA:	Take away his credit cards.'),
(392, 'FIN. An arm. A one finned fellow; a man who has lost\r\n  an arm. SEA PHRASE.'),
(393, '06.007\nThe Liber Asian frees us by subjecting our oppressors to God.'),
(394, '"Creation science" has not entered the curriculum for a reason so simple\r\nand so basic that we often forget to mention it: because it is false, and\r\nbecause good teachers understand exactly why it is false.  What could be\r\nmore destructive of that most fragile yet most precious commodity in our\r\nentire intellectualy heritage -- good teaching -- than a bill forcing\r\nhonorable teachers to sully their sacred trust by granting equal treatment\r\nto a doctrine not only known to be false, but calculated to undermine any\r\ngeneral understanding of science as an enterprise?\r\n-- Stephen Jay Gould, "The Skeptical Inquirer", Vol. 12, page 186'),
(395, 'You should never wear your best trousers when you go out to fight for\r\nfreedom and liberty.\r\n		-- Henrik Ibsen'),
(396, 'Dear Emily, what about test messages?\n		-- Concerned\n\nDear Concerned:\n	It is important, when testing, to test the entire net.  Never test\nmerely a subnet distribution when the whole net can be done.  Also put "please\nignore" on your test messages, since we all know that everybody always skips\na message with a line like that.  Don''t use a subject like "My sex is female\nbut I demand to be addressed as male." because such articles are read in depth\nby all USEnauts.\n		-- Emily Postnews Answers Your Questions on Netiquette'),
(397, 'SMASH. Leg of mutton and smash: a leg of mutton and\r\n  mashed turnips. SEA TERM.'),
(398, 'A businessman is a hybrid of a dancer and a calculator.\n		-- Paul Valery'),
(399, 'The National Short-Sleeved Shirt Association says:\r\n	Support your right to bare arms!'),
(400, 'You buttered your bread, now lie in it.'),
(401, 'Marge: Oh, Homer, there seems to be a lot of good obedience schools here.\r\nBart: Oh, school, right, yeah, that''s your answer to everything...\r\n\r\n	-- finding a school for Santa''s Little Helper,\r\n	  "Bart''s Dog Gets an F"'),
(402, 'Got Mole problems?  Call Avogadro at 6.02 x 10^23.'),
(403, 'QOTD:\r\n	"Of course there''s no reason for it, it''s just our policy."'),
(404, 'If it pours before seven, it has rained by eleven.'),
(405, 'The magnitude of the goof is in direct proportion to the cost of the fabric\n		-- Murphy''s Laws of Sewing nÂ°10'),
(406, 'T--D. There were four t--ds for dinner: stir t--d, hold\r\n  t--d, tread t--d, and mus-t--d: to wit, a hog''s face, feet\r\n  and chitterlings, with mustard. He will never sh--e a\r\n  seaman''s t--d; i.e. he will never make a good seaman.'),
(407, 'Why do we want intelligent terminals  when there are so many stupid users?'),
(408, 'From "Monty Python and the Holy Grail"\n\n      [clop clop]\nARTHUR:  Halt!  Hallo!  Hallo!\nGUARD:  ''Allo!  Who is zis?\nARTHUR:  It is King Arthur, and these are the Knights of the Round Table.  Who''s\n         castle is this?\nGUARD:  This is the castle of my master, Guido Wommer!\nARTHUR:  Go and tell your master that we have been charged by God with a sacred\n         quest.  If he will give us food and shelter for the night he can join\n         us in our quest for the Holy Grail.\nGUARD:  Well, I''ll ask him, but I don''t think he''ll be very keen... Uh, he''s\n        already got one, you see?\nARTHUR:  What?\nGALAHAD:  He says they''ve already got one!'),
(409, 'Cheer up, the worst is yet to come.'),
(410, 'CHILDREN''S BOOKS YOU''LL NEVER SEE:\r\n"Mister Policeman Eats His Service Revolver"');
